    [[setPoints objectAtIndex:aIndex] setObject:[NSString stringWithFormat:@"%.3f",value] forKey:@"readBack"];

    [[NSNotificationCenter defaultCenter] postNotificationName:ORHVcRIOModelSetPointChanged object:self];

}

